import React from 'react';
import { Link } from 'react-router-dom';
import './ExitMenu.scss';

const ExitMenu = props => {
  return (
    <div id="exit-menu">
      <button type="button" onClick={props.closeModal}>
          EXIT
      </button>
    </div>
  );
}

export default ExitMenu;
